        version=\"0.7.3\" ident=\"GROBID\" when=\"2025-10-23T19:06+0000\">\n\t\t\t\t\t<desc>GROBID
        - A machine learning software for extracting information from scholarly documents</desc>\n\t\t\t\t\t<ref
        target=\"https://github.com/kermitt2/grobid\"/>\n\t\t\t\t</application>\n\t\t\t</appInfo>\n\t\t</encodingDesc>\n\t\t<profileDesc>\n\t\t\t<abstract>\n\t\t\t\t<p>In
        this paper, we study instanton corrections in the N = 2 \u22C6 gauge theory
        by using its description in string theory as a freely-acting orbifold. The
        latter is used to compute, using the worldsheet, the deformation of the Yang-Mills
        action. In addition, we calculate the deformed instanton partition function,
        thus extending the results to the non-perturbative sector of the gauge theory.
        As we point out, the structure of the deformation is extremely similar to
        the \u2126-deformation, therefore confirming the universality of the construction.
        Finally, we comment on the realisation of the mass deformation using physical
        vertex operators by exploiting the equivalence between Scherk-Schwarz deformations
        and freely-acting orbifolds.</p>\n\t\t\t</abstract>\n\t\t</profileDesc>\n\t</teiHeader>\n\t<text
